import express from "express";
import axios from "axios";

const app = express();

app.get("/test-dgi", async (req, res) => {
  try {
    // Exemple POST simple
    const response = await axios.post(
      "https://teledeclaration-dgi.cm/modules/Common/Account/contribuable_pp.aspx?t=PPNP",
      new URLSearchParams({
        // paramètres du formulaire (à adapter !)
        findIdemployeur_dirigeant$txtNIUCONTRIBUABLE:'ejara',
        __VIEWSTATE: ""
      }),
      {
        headers: {
          "Content-Type": "application/x-www-form-urlencoded",
          "User-Agent": "Mozilla/5.0 (Node.js Express)",
        },
      }
    );

    // Affiche brut côté serveur
    console.log(response.data);

    // Retourne brut côté client
    res.send(response.data);
  } catch (error) {
    console.error(error.message);
    res.status(500).json({ error: error.message });
  }
});

app.listen(3000, () => console.log("🚀 Server running on http://localhost:3000"));
